        <p>{team.name}</p>
      <div className='hide'>
      <p>{team.venue}</p>
      <p>{team.founded}</p>
      <p>{team.clubColors}</p>
      <p>{team.website}</p>
      <p>{team.email}</p>
      <p>{team.phone}</p>
      <p>{team.address}</p>

      </div>
    </section>
  )
};

export default Card;
